import React from 'react'
import TMDB from './'

const FilmPoster = (props) => {
    var posterUrl = "https://image.tmdb.org/t/p/w500"

    return (
        <div>
           <img src={posterUrl+props.img} alt="" />
           {TMDB.films.poster_path}
        </div>
    )
}

export default FilmPoster
